INSERT INTO `movie` (`movie_id`, `title`, `description_short`, `description_long`, `year`, `rating`, `genre_id`, `actors`, `featured`, `kids_restriction`, `url`, `trailer_url`) VALUES
(1, 'UPWORK - Freelancers Platform', '', '', 2019, 0, 1, '[\"1\",\"2\"]', 1, 0, 'https://www.youtube.com/watch?v=Cu4qwicB154', 'https://www.upwork.com'),
(2, 'The Business Model Canvas', '', '\"The business model canvas is a great tool to help you understand a business model in a straightforward, structured way. Using this canvas will lead to insights about the customers you serve, what value propositions are offered through what channels, and how your company makes money. You can use the business model canvas to understand your own business model or that of a competitor! The business model canvas was created by Alexander Osterwalder, of Strategyzer.\r\n\r\nThe Business Model Canvas can be printed out on a large surface so groups of people can jointly start sketching and discussing business model elements with post-it notes or board markers. It is a hands-on tool that fosters understanding, discussion, creativity, and analysis. It is distributed under a Creative Commons license from Strategyzer AG and can be used without any restrictions for modeling businesses.\"', 2019, 0, 1, '[\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=QoAOzMTLP5s', 'https://www.strategyzer.com/canvas/business-model-canvas'),
(3, 'B Plans', '', '\"Bplans contains the largest single online collection of free sample business plans. In addition, it has helpful tools and guides to help you manage your business better. Bplans includes practical advice on planning, interactive tools and calculators, and publishes daily advice that will help you grow your business.\r\n\r\nBplans is owned and operated by Palo Alto Software, Inc. as a free resource to help entrepreneurs build better businesses. Palo Alto Software develops, publishes, and markets award-winning software to help entrepreneurs write business plans, pitch for funding, and track their progress towards their goals.\r\n\r\nFinally, Bplans is also the home to Time Berry\'s blog. Tim is the founder and chairman of Palo Alto Software and is passionate about bringing good business planning processes to businesses large and small. Tim focuses on creating planning processes that optimize for management and accountability.\"', 2019, 0, 1, '[\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=_9-1zfIRJA8', 'https://www.bplans.com/'),
(4, 'Small Business Administration ', '', 'The U.S. Small Business Administration (SBA) is a United States Government agency that provides support to entrepreneurs and small businesses. The mission of the Small Business Administration is \"to maintain and strengthen the nation\'s economy by enabling the establishment and viability of small businesses and by assisting in the economic recovery of communities after disasters\". The agency\'s activities are summarized as the \"3 Cs\" of capital, contracts and counseling. ', 2019, 0, 1, '[\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=SMr_uLZV-eM', 'https://www.sba.gov/business-guide/plan-your-business/write-your-business-plan#section-header-14'),
(5, 'Trello', '', '\"Trello is an incredibly versatile tool for project management. It’s flexibility allows for it to be a simple tool for personal organization or a powerful engine for product development with large teams.\r\n\r\nTrello is a task management app that gives you a visual overview of what is being worked on and who is working on it. It used the Kanban system, which was developed in Toyota as a system to keep production levels high and maintain flexibility. It is best represented as a whiteboard filled with post-it notes. Each post-it represents different tasks involved in the project. \r\nTrello is a system of boards, lists and cards. This creates a system that allows for individuals or teams to track a project and collaborate or contribute where they can be most useful or where it is most needed.\r\n\r\nBoard\r\nA board is typically a project or product that is under development or consistently being worked on.</p>\r\n\r\n\r\nA board has specific members that can see it and control the creation and flow of cards between the lists. They can add themselves or others to cards, begin conversations on the cards, add attachments and create checklists.\r\n\r\nList\r\n\r\nA list is a way to divide a board into different categories. Typically a list represents a stage of progress (to do, in progress, finished).\r\n\r\nFor David Allen (Getting Things Done) fans, lists are a great for setting up different “buckets” to organize your tasks.\r\n\r\nCard\r\n\r\nA card is the most basic and flexible part of the system. It represents a specific element of a project (A new feature, a software bug, research for a post). Cards can be moved between lists as they progress through the project. Depending on what works best for you and your team, an individual task could be a card or it could be an item on a checklist within a card, or an image.\r\n\r\nYou can attach images and files, assign members, comment, add checklists, colored labels and deadlines to cards. Depending on the what’s best for you and the task at hand, you can keep your cards very simple, or highly detailed and elaborate.\"', 2019, 0, 2, '[\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=tVooja0Ta5I', 'https://trello.com/signup '),
(6, 'Asana', '', '\"Asana is one of the most popular project management software currently available on the market. The robust work management platform serves your teams so they can stay focused on the goals, projects, and daily tasks as you grow your business.\r\n\r\nTo get your works organized, Asana enables you to plan and structure work in a way that’s best for you. It handily lets you set priorities and deadlines, share details and assign tasks—all in one place. To stay on track, it allows you to follow projects and tasks through every stage. You know where work stands and can keep everyone aligned on goals.\r\n\r\nTo help you meet deadlines, the platform lets you create visual project plans to see how every step maps out over time. With it it’s much easier to pinpoint risks and eliminate roadblocks. Even when plans change.\r\n\r\nSee where everything stands. Asana’s boards lets you easily visualize your work. Move work through multiple stages quickly, easily, and beautifully.\r\nNever miss a deadline again Use Timeline to create a plan that shows you how the pieces of your project fit together, and helps you keep work on track as things change.\r\n\r\nTie it all together Bring emails, files, tickets, and more into Asana with over 100 integrations to choose from, so you can see everything in one place.\r\n\r\nSee the big picture Nail your timing by viewing work on a calendar. Easily spot holes and overlaps in your schedule and quickly make adjustments.\r\n\r\nReport on your work. Share results with your team and see how work is progressing to see what’s on track and what needs attention.\r\n\r\nKeep track of what’s most important Use custom fields to track the info that’s most important to your team or company, so it stays front and center.\r\nNo need to reinvent the wheel Turn common processes into templates your whole team can use, so projects run smoothly every time.\r\nShare info with the right people;Make teams and projects private to create a safe space for sensitive work.', 2019, 0, 2, '[\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=nrzMJ2IssvI', 'https://asana.com/ '),
(7, 'Wrike', '\"Wrike offers the same flexibility of a spreadsheet—with columns for every bit of info you want to track about tasks—combined with reminders and Gantt chart views (premium plans only) that will keep your work on track.\r\n\r\nWrike lets your team update the status of tasks at various intervals—in-progress, on hold, cancelled, or completed—letting you track the status of all project tasks in detail. Additionally, you can set the status of projects to green, yellow, red, on hold, or cancelled, making it easy to create your weekly project status reports.\"', '', 2019, 0, 2, '[\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=CjaLQYuSafI', 'https://www.wrike.com'),
(8, 'Coursera', '\"Coursera is an online learning platform founded by Stanford professors Adnrew Ng and Daphne Koller that offers courses, specializations, and degrees. Coursera works with universities and other organizations to offer online courses, specializations, and degrees in a variety of subjects, such as engineering, humanities, medicine, biology, social sciences, mathematics, business, computer science, digital marketing, data science, and others.\r\n\r\nCoursera courses last approximately four to ten weeks, with one to two hours of video lectures a week. These courses provide quizzes, weekly exercises, peer-graded assignments, and sometimes a final project or exam. Courses are also provided on-demand, in which case users can take their time in completing the course with all of the material available at once. As of May 2015 Coursera offered 104 on-demand courses. \"', '', 2019, 0, 3, '[\"4\"]', 0, 0, 'https://www.youtube.com/watch?v=PojLL3E-zk0', 'https://www.coursera.org/'),
(9, 'Alison', '', '\"ALISON is a free online education platform that mostly focuses on workplace-based skills. It was founded in Galway, Ireland, by Irish Entrepreneur Mike Feerick on 21 April 2007.\r\n\r\nIt has 11 million registered learners, 1.5 million graduates, and 1,000 courses available for free access in December 2017. Alison\'s learners have access to courses published by institutions like Columbia University, Cambridge University, Yale University, and companies such as Microsoft and Google\r\n\r\nAlison currently offers more than a thousand courses at certificate, diploma, and learning path levels across nine core subject categories. The certificate level courses require two to three hours of study while the more rigorous diploma level courses require ten to fifteen hours of study. There is no time limit for completing a course. One of Alison\'s courses is ABC IT, a fifteen to twenty-hour training suite which is cited by The New York Times as \"\"covering similar ground\"\" to the International Computer Driving License without the cost of certification.\"', 2019, 0, 3, '[\"11\"]', 0, 0, '', 'https://alison.com/'),
(10, 'Saylor', '', '', 2019, 0, 3, '[\"3\",\"4\",\"8\",\"9\",\"11\"]', 0, 0, '', 'https://www.saylor.org/'),
(11, 'Khan Academy', '', 'Khan Academy offers practice exercises, instructional videos, and a personalized learning dashboard that empower learners to study at their own pace in and outside of the classroom. We tackle math, science, computer programming, history, art history, economics, and more. Our math missions guide learners from kindergarten to calculus using state-of-the-art, adaptive technology that identifies strengths and learning gaps. We\'ve also partnered with institutions like NASA, The Museum of Modern Art, The California Academy of Sciences, and MIT to offer specialized content.', 2019, 0, 3, '[\"3\",\"4\",\"8\",\"9\",\"11\"]', 0, 0, 'https://youtu.be/c9WZchczdXY', 'https://www.khanacademy.org/'),
(12, 'Codeacademy ', '', '\"Codecademy is an online interactive platform that offers free coding classes in 12 different programming languages including Python, Java, JavaScript (JQuery, AngularJS, React.js), Ruby, SQL, C++, and Sass, as well as markup languages HTML and CSS. The site also offers a paid \"\"pro\"\" option that gives users access to a personalized learning plan, quizzes, realistic projects, and live help from advisors.\r\n\r\nThe platform also provides courses for learning command line and;In September 2015, Codecademy, in partnership with Periscope, added a series of courses designed to teach SQL, the predominant programming language for database queries. In October 2015, Codecademy created a new course, a class on Java programming. As of January 2014, the site had over 24 million users who had completed over 100 million exercises. The site has received positive reviews from the New York Times and Tech Crunch.\"', 2019, 0, 3, '[\"3\"]', 0, 0, 'https://www.youtube.com/watch?v=IqAz-PPzbcg', 'https://www.codecademy.com/'),
(13, 'KickStarter ', '', '\"Kickstarter helps artists, musicians, filmmakers, designers, and other creators find the resources and support they need to make their ideas a reality. To date, tens of thousands of creative projects — big and small — have come to life with the support of the Kickstarter community.\r\n\r\nKickstarter is an enormous global community built around creativity and creative projects. Over 10 million people, from every continent on earth, have backed a Kickstarter project.\r\n\r\nSome of those projects come from influential artists like De La Soul or Marina Abramović. Most come from amazing creative people you probably haven’t heard of — from Grandma Pearl to indie filmmakers to the band down the street.\r\n\r\nEvery artist, filmmaker, designer, developer, and creator on Kickstarter has complete creative control over their work — and the opportunity to share it with a vibrant community of backers.\r\nSince the launch, on April 28, 2009, 6 million people have backed a project, $4.2 billion has been pledged, and;161,597 projects have been successfully funded. \"', 2019, 0, 4, '[\"6\",\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=1KTvNF68LSw', 'https://www.kickstarter.com/'),
(14, 'GoFundMe', '', 'GoFundMe is a for-profit crowdfunding platform that allows people to raise money for events ranging from life events such as celebrations and graduations to challenging circumstances like accidents and illnesses. From 2010 to 2017, over $5 billion was raised on the platform for over two million individual campaigns and 50 million donors.', 2019, 0, 4, '[\"6\",\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=Py83gOa-9Go', 'https://www.gofundme.com/'),
(15, 'Indiegogo', '', '\"Crowdfunding on Indiegogo empowers people to unite around the ideas that matter to them, and together make those ideas come to life. Whether you\'re searching for the latest in tech, supporting your favorite independent filmmaker, or helping an important cause, you can find something that inspires you on Indiegogo. Crowdfunding generates exciting opportunities for backers and entrepreneurs alike, but there are some basic facts that all backers should know.\r\n\r\nIt is important to understand that backing a campaign and claiming a perk are<strong> </strong>not the same as buying an item online. Instead, supporting a crowdfunding idea on a platform like Indiegogo means you are helping a work-in-progress project, idea or cause. We want to let our community dream big, so we don\'t have criteria for what kind of project can become an Indiegogo campaign, other than what\'s outlined in our Terms of Use.\r\n\r\nGet set up\r\n\r\nOur platform gives you freedom and flexibility to customize your campaign as you want: You get to decide on your fundraising target, create perks to reward backers, and set a campaign deadline (up to 60 days).\r\n\r\nLaunch your campaign\r\n\r\nYou decide when to make your campaign live – no approvals necessary. Once your campaign is launched, be sure to tweet, email, and shout from the rooftops – tell everyone!\r\n\r\nContinue raising with InDemand\r\n\r\nAfter your crowdfunding campaign is over, continue raising money and building your community for as long as you’d like. No fundraising target, no time limits.\"', 2019, 0, 4, '[\"6\",\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=RJo3mPCIJYI', 'https://www.indiegogo.com/'),
(16, 'DropBox', '', '\"Dropbox is a home for all your work. You can store and share files, collaborate on projects, and bring your best ideas to life—whether you’re working alone or as part of a team.\r\n\r\nStore and access files from anywhere. Bring your work together in one safe place. Get to your files from a computer, phone, or tablet—changes you make from one device will automatically sync across all your devices.\r\n\r\nShare files big or small. Send files to anyone, even if they don’t have a Dropbox account. Files you share using Dropbox always stay up-to-date, letting you and your team stay on the same page.\"', 2019, 0, 5, '[\"3\"]', 0, 0, 'https://www.youtube.com/watch?v=QADSH8XYx_A', 'https://www.dropbox.com/?landing=dbv2'),
(17, 'Google Drive', '\"Google Drive is a cloud storage service, and like any cloud storage service its main purpose is to expand your ability to store files beyond the limits of your hard drive. Cloud storage is sometimes confused with online backup, which achieves a very different purpose using similar infrastructure.\r\n\r\nYou can read more about the difference between cloud storage and online backup in our article on that subject. However, simply put, online backup is designed to replicate your hard drive rather than expand it, with the goal of disaster recovery. As we’ll mention later, Google Drive has recently started to expand into the online backup market by letting you tag any folder for backup. \r\nGoogle will give you 15GB of free cloud storage just for signing up. However, it’s important to realize that all of that free space is shared between Google Drive, Google Photos and Gmail.\"', '', 2019, 0, 5, '[\"3\"]', 0, 0, 'https://www.youtube.com/watch?v=cCZj5ojxRAA', 'https://www.google.com/drive/'),
(18, 'Sync', '', '\"The cloud storage service has been developed while keeping privacy in mind. While a lot of services allow users to save their data, most of us are skeptical because we don’t want a third party service to access our data. This is the reason Sync.com guarantees high security with zero knowledge policy, which means even the company doesn’t know what data users are storing on their servers. \r\n\r\nThe service is deeply embedded on Windows, just like OneDrive, making it an easy-to-use service for both novices and advanced users. It has file sharing and syncing capabilities required by almost all the users today. Though, users should know that this can prove to be expensive if it is strictly used as a backup service. In fact, we wouldn’t recommend using this as an online backup service only, since you would be limiting its features when you are paying for all of it.\r\nSync.com can also be a great Dropbox alternative for business users. This is because unlike Dropbox, user data is protected by both local and server-side encryption and the company has a complete zero knowledge policy towards user data.\"', 2019, 0, 5, '[\"3\"]', 0, 0, 'https://www.youtube.com/watch?v=SDAx68OBvM8', 'https://www.sync.com/'),
(19, 'Canva', '', '\"Canva is a drag-and-drop tool with millions of images and hundreds of fonts. Over ten million users have created over 100 million designs with the help of Canva’s user-friendly interface. While nothing will replace the instinct and creativity of a trained graphic designer, Canva offers a tool for simple, creative designs.\r\n\r\nWhether you want custom social media icons for your website or new business cards for your sales team, Canva has free tools to support your visual projects. You can edit photos, create graphs, and develop print media. When you need a graph for your website or an upcoming presentation, you can start with a wide range of templates to graphically represent your data. When it comes to social media management, you may know that it can be a hassle to get images in exactly the right dimensions for each social media platform. With Canva, the images practically format themselves. Whether you need an ebook cover or Instagram post, Canva can hook you up with the proper dimensions. And, when you need to adapt a graphic for something new, you can even copy images from one project to the next.\r\nThe variety of free templates, images, and other resources is staggering, and it is the ease of use that really puts this program in a league of its own. As if that weren’t enough, you can do the work in your web browser—no need to install software or download updates.Exploring their site is the best way to understand the full range of tools and options available.\"', 2019, 0, 6, '[\"6\"]', 0, 0, 'https://www.youtube.com/watch?v=AFk7erzR5S0', 'https://www.canva.com/'),
(20, 'Easil', '\"Meet Easil, the DIY design secret weapon your whole team will love. Our easy to use brand tools will ensure your designs are used in the right way by your team, every time.\r\n\r\nEasil is the Drag-and-Drop design tool that helps you create visual content that’s SO good, it looks like a Pro designed it. <br>You’ll be creating posters, flyers, social media graphics, GIFs, menus and more with Easil’s modern, edgy templates.  Or build a catalogue of exclusive brand templates to share, just with your own team.\r\n\r\nEasil’s Brand Kit lets you store and access the right colors, fonts, imagery and logos for your brand in the one place, every time. From header and body fonts, to trademarks and multiple color palettes, Brand Kit is always up to date and ready to use. Now you can access multiple assets for projects, quickly and easily, whether solo or in a team. Brand Kit is at your fingertips, 24/7.\"', '', 2019, 0, 6, '[\"6\"]', 0, 0, 'https://www.youtube.com/watch?v=FnHGtczzj14', 'https://app.easil.com/signup'),
(21, 'Stencil', '', '\"Stencil is a graphic design tool that is all about creating social media images easily and quickly (as well as ad images, marketing images and email images). It’s designed to be a tool that you can access quickly in your browser to produce a quick image and post it, so I wanted to include it as one of the Canva alternatives.\r\n\r\nOne of the features I do like about Stencil is their huge library of quotes that you can use to quickly import into your image and create fresh content. I have used these many times before when trying to plan what to post for images. The quote section has a great search function too so you can search by the person saying the quote OR by quote keyword or phrase.\r\n\r\nStencil’s template selection is much smaller than other tools on this list of Canva alternatives, but for quick, easy posts, it’s a basic selection to get you started.\r\nI also love that you can access so many fonts with their Google Web Font integration and it has a solid selection of images/photos and design icons. So, if you wanted to go beyond creating a quick image, you could get more creative.\"', 2019, 0, 6, '[\"6\"]', 0, 0, 'https://www.youtube.com/watch?v=GI-Yb0Pv9Y0', 'https://getstencil.com/'),
(22, 'Buffer', '', '\"Buffer is a new and smarter way to share what you want to share on Social Media. People have called it great names before, like your Social Media Assistant or the Siri of Social Media.\r\n\r\nWhat it does is simple. Posts in your queue will be sent out automatically by Buffer, according to the posting schedule that you put in place.\r\n\r\nSelect the social account you’d like to customize the posting schedule for, select the Settings tab at the top, and then select Posting Schedule. From here, you can choose which timezone is best for this account and customize the days and times your posts should go out. Select the days you’d like to include and add the individual times you’d like your content to be shared.\r\nIt’s like your magic box you can use anytime to fill with great Tweets, Facebook stories or LinkedIn updates. Just drop them in and you don’t have to ever worry about when it will be posted, it’s all taken care of by Buffer for you.\r\n\"', 2019, 0, 7, '[\"6\"]', 0, 0, 'https://www.youtube.com/watch?v=rjc-ggH-Gkw', 'https://buffer.com/'),
(23, 'Later', '', '\"Later is a visual content planner that offers direct publishing and scheduling to Instagram, Twitter, Facebook, and Pinterest. You can create a free account to manage one of each of the aforementioned social profiles for one brand. If you create your account with Instagram, you’ll be prompted to set up direct publishing on your first login.\r\n\r\nOnce you set up the app, you can start dragging photos from your computer to your Later calendar & schedule them to post to your business account.\"', 2019, 0, 7, '[\"6\"]', 0, 0, 'https://www.youtube.com/watch?v=wgZ-0Ju-b24', 'https://later.com/'),
(24, 'Preview', 'Preview is your visual planner for Instagram. Predict what your feed will look like before you post anything on Instagram. It has all the features you need in one app. No more switching between multiple apps.', '', 2019, 0, 7, '[\"6\"]', 0, 0, 'https://www.youtube.com/watch?v=6OtHHDdXuU4', 'https://thepreviewapp.com/'),
(25, 'Duolingo', 'DuoLingo is a platform that includes a language-learning website and app, as well as a digital language proficiency assessment exam. The app and the website are free. Duolingo also offers a premium service for a fee. As of January 2019 the language-learning website and app offer 85 different language courses in 24 languages. The app has about 300 million registered users across the world.', '', 2019, 0, 9, '[\"4\",\"6\"]', 0, 0, 'https://www.youtube.com/watch?v=WyzJ2Qq9Abs', 'https://www.duolingo.com/'),
(26, 'The Hamilton Challenge', '', 'The Hamilton Challenge in a free video series that promotes creativity, critical thinking, and problem solving through entrepreneurship. This Challenge is sponsored by the Brian Hamilton Foundation.', 2019, 0, 10, '[\"6\",\"8\"]', 1, 0, 'https://www.youtube.com/watch?v=StW2KD0t1zw', 'https://hamiltonchallenge.org/'),
(27, 'Fiverr', 'Fiverr is the world’s largest marketplace for digital services. Fiverr enables you to browse the selection of freelancers offering services, and to place orders in just one click. A service offered on Fiverr is called a Gig. It is classified as a freelance marketplace and offers many diverse jobs and services. Fiverr is considered a micro-task blog, much like other sites like Taskrabbit or Thumbtack, and offers many jobs at comparable rates.', '', 2019, 0, 10, '[\"6\",\"8\"]', 0, 0, 'https://www.youtube.com/watch?v=4UKNtB-oNvA', 'https://www.fiverr.com/');
